export class Card{

    constructer(front, back){
        this.front = front;
        this.back = back;
    }

    setFront(front){
        this.front = front;
    }

    setBack(back){
        this.back = back;
    }

    getFront(){
        return this.front;
    }

    getBack(){
        return this.back;
    }
}
